import React from "react";
 
 
class Weather extends React.Component {
  render() {
    return (
      <div>
      { this.props.city &&
        <div>
          <p>City: {this.props.city}, {this.props.country}</p>
          <p>T: {this.props.temp}</p>
          <p>B: {this.props.sunrise}</p>
          <p>3: {this.props.sunset}</p>
        </div>
      }
      </div>  
    );
  }
}
 
 
 
export default Weather;
